import React from 'react';
import Box from '@mui/material/Box';
import Skeleton from '@mui/material/Skeleton';

function LoadingBox() {
  return (
    
    <Box key={index} sx={{ width: 210, marginRight: 0.5, my: 5 }}>
              <Skeleton />
              <Skeleton width="60%" />
            </Box>
   
  );
}

export default LoadingBox;
